import React from 'react';
import Button from '@material-ui/core/Button';

function HomePage() {
  const handleButtonClick = () => {
    console.log('Welcome!');
  };

  return (
    <Button variant="contained" color="primary" onClick={handleButtonClick}>
      Welcome
    </Button>
  );
}

export default Home;
